s is different from the mean rating of foreign reviews. \n\n The p-value is then used to assess the significance of the difference in mean rating between the two groups.]]\u003e\u003c/Text\u003e\u003c/Page\u003e\u003c/Pages\u003e\u003c/Report\u003e", width: "", output_is_light_prose: false };
